DROP TABLE IF EXISTS `customers`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `customers` (
  `CUSTOMER_ID` int(15) NOT NULL AUTO_INCREMENT,
  `LAST_NAME` char(50) CHARACTER SET latin1 DEFAULT NULL,
  `FIRST_NAME` char(50) CHARACTER SET latin1 DEFAULT NULL,
  `MIDDLE_NAME` char(50) CHARACTER SET latin1 DEFAULT NULL,
  `GENDER` tinyint(4) DEFAULT NULL COMMENT '0-MALE, 1-FEMALE',
  `PREFIXES_NAME` char(10) CHARACTER SET latin1 DEFAULT NULL,
  `ADDRESS` varchar(300) DEFAULT NULL,
  `EMAIL_ADDRESS` char(50) CHARACTER SET latin1 DEFAULT NULL,
  `CONTACT_NO` char(30) CHARACTER SET latin1 DEFAULT NULL,
  `PHOTO` blob,
  `MOBILE_NO_1` char(30) CHARACTER SET latin1 DEFAULT NULL,
  `MOBILE_NO_2` char(30) CHARACTER SET latin1 DEFAULT NULL,
  `MOBILE_NO_3` char(30) CHARACTER SET latin1 DEFAULT NULL,
  `FACEBOOK_ACCNT` char(50) CHARACTER SET latin1 DEFAULT NULL,
  `INSTAGRAM_ACCNT` char(50) CHARACTER SET latin1 DEFAULT NULL,
  `TWITTER_ACCNT` char(50) CHARACTER SET latin1 DEFAULT NULL,
  `BUS_NAME` char(150) CHARACTER SET latin1 DEFAULT NULL,
  `BUS_PHONE` char(30) CHARACTER SET latin1 DEFAULT NULL,
  `BUS_ADDRESS` varchar(400) DEFAULT NULL,
  `TYPE_CUS_RETAIL` tinyint(1) DEFAULT NULL COMMENT '0-FALSE, 1-TRUE',
  `TYPE_CUS_BUSINESS` tinyint(1) DEFAULT NULL COMMENT '0-FALSE, 1-TRUE',
  `TYPE_CUS_WHOLE_LOW` tinyint(1) DEFAULT NULL COMMENT '0-FALSE, 1-TRUE',
  `TYPE_CUS_WHOLE_HIGH` tinyint(1) DEFAULT NULL COMMENT '0-FALSE, 1-TRUE',
  `STORE_ID` int(11) DEFAULT NULL COMMENT 'WHERE CUSTOMER REGISTER',
  `SALES_ASSOCIATE` int(15) DEFAULT NULL COMMENT 'CUSTOMER MAY REFER BY EMPLOYEE OF CDG',
  `MONTHLY_AVE_3` decimal(10,0) DEFAULT NULL,
  `MOTHLY_AVE_6` decimal(10,2) DEFAULT NULL,
  `UPDATED_AT` int(11) DEFAULT NULL,
  `UPDATED_BY` int(15) DEFAULT NULL,
  `CREATED_AT` int(11) DEFAULT NULL,
  `CREATED_BY` int(15) DEFAULT NULL,
  PRIMARY KEY (`CUSTOMER_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='This store all customers information';
/*!40101 SET character_set_client = @saved_cs_client */;

